import searchicon from "../configs/media/searchicon.png"
import Body from "./Body";
import Food_Carousal from "./Food_Carousal";
import { useState, useEffect } from "react";
const Searchbody = () =>{
    const [searchInput, setsearchInput] = useState("");
    // const [food_data, setfood_data] = useState([]);

    const [filterbutton, setfilterbutton]= useState(false);

    return(
        <div className="filter-search-body-div">
                <div className="filter-search-div flex justify-center items-center">
                    <div className="btn-container">  

                    <button onClick={() => {
                        if (filterbutton) {
                            setfilterbutton(false);
                        } else {
                            setfilterbutton(true);
                        }
                    }} className="px-6 py-3 bg-orange-500 text-white mx-4 rounded-xl transition-transform duration-500 ease-in-out hover:scale-90" >
                        Filter
                    </button>


                    </div>

                    <div className="searchbar-container bg-slate-200 px-6 py-3 rounded-lg">
                        <div className="child-searchbar-div flex items-center">
                            <input className="searchinput bg-slate-200 outline-none" placeholder="Search for restaurent" type="search" value={searchInput} onChange={
                                (event)=>{
                                    setsearchInput(event.target.value);
                                }
                            }></input>
                            <button className="search-btn" onClick={()=>{
                                console.log("button clicked")
                            }}><img src={searchicon} width="30" className="search-icon-png" aria-label="Search"></img></button>
        
                        </div>
                    </div>
                    
                </div>

                
                <Body searchdata={searchInput} filterbtnstatus={filterbutton}/>

            </div>
    )
}

export default Searchbody;
